// generic functions
function randomPassword() {
    $alphabet = "abcdefghijklmnopqrstuwxyzABCDEFGHIJKLMNOPQRSTUWXYZ0123456789";
    $pass = array(); //remember to declare $pass as an array
    $alphaLength = strlen($alphabet) - 1; //put the length -1 in cache
    for ($i = 0; $i < 8; $i++) {
        $n = rand(0, $alphaLength);
        $pass[] = $alphabet[$n];
    }
    return implode($pass); //turn the array into a string
}

function applyFilters(Array $filters = [], $actionName){
    $continue = true;

    for($filterIndex = 0; $filterIndex < count($filters) && $continue; $filterIndex++){
        $filter = $filters[$filterIndex];

        if(in_array($actionName, $filter['actions'])){
            $continue = $filter['filter']($actionName);
        }
    }

    return $continue;
}

function startsWith($haystack, $needle) {
    // search backwards starting from haystack length characters from the end
    return $needle === "" || strrpos($haystack, $needle, -strlen($haystack)) !== FALSE;
}

function scanDirectory($pattern){
    $files = glob($pattern);
    usort($files, function($file_1, $file_2){
        $file_1 = filectime($file_1);
        $file_2 = filectime($file_2);
        if($file_1 == $file_2)
        {
            return 0;
        }
        return $file_1 > $file_2 ? 1 : -1;
    });

    return $files;
}

function render($renderFunction, $options = []){
    ob_start();

    $renderFunction($options);

    $result = ob_get_contents();
    ob_end_clean();

    return $result;
}

function getCurrentContent($path){
    return ((($currentContent = @file_get_contents($path)) === false)?'':$currentContent);
}

function startSession(){

    if (session_status() == PHP_SESSION_NONE) {
        session_start(); 
    }
}

function hasConfiguration(){
    return array_key_exists('configuration', $GLOBALS);
}

function getConfiguration(){
    return $GLOBALS['configuration'];
}

function getRequestValue($name, $default = null, $source = null){

    if($source === null){
        $source = $_POST;
    }
    return isset($source[$name])?$source[$name]:$default;
}

function getPostValue($name, $default = null){
    return getRequestValue($name, $default);
}

function getGetValue($name, $default = null){
    return getRequestValue($name, $default, $_GET);
}

function getLocation($pages, $defaultPageName){
    $pageNameCandidate = getGetValue('page', getGetValue('action', $defaultPageName));

    if(!in_array($pageNameCandidate, $pages)){

        if($pageNameCandidate === $defaultPageName){
            throw new Exception("defaultPageName = $defaultPageName doesn't exist");
        }else{
            $pageName = $defaultPageName;
        }
    }else{
        $pageName = $pageNameCandidate;
    }

    return $pageName;
}

function giveAdminAccess(){
    startSession();

    $_SESSION['isAdmin'] = true;
}

function removeAdminAccess(){
    startSession();

    unset($_SESSION['isAdmin']);
}

function hasAdminAccess(){
    startSession();

    return isset($_SESSION['isAdmin']);
}

