$pages = [
    'request' => function() use ($views){
        $configuration = getConfiguration();

        $changedContent = getPostValue('changeRequestContent');

        if($changedContent === null){
            $currentContent = getCurrentContent($configuration['currentPath']);
        }else{
            $currentContent = $changedContent;
        }

        $options = [
            'label' => $configuration['label'],
            'description' => $configuration['description'],
            'content' => htmlspecialchars($currentContent),
        ];

        return render($views['request'], $options);
    },
    'submit' => function() use ($views){
        $configuration = getConfiguration();

        $currentContent = getCurrentContent($configuration['currentPath']);
        $currentChangeContent = htmlspecialchars_decode(getPostValue('changeRequestContent'));

        if($currentChangeContent === null){
            header('Location: ?');
        }else{   
            $options = [
                'label' => $configuration['label'],
                'description' => $configuration['description'],
                'currentContent' => htmlspecialchars($currentContent),
                'currentChangeContent' => htmlspecialchars($currentChangeContent),
            ];

            return render($views['submit'], $options);
        }
    },
    'confirm' => function() use ($views){
        $configuration = getConfiguration();

        $currentChangeContent = getPostValue('changeRequestContent');

        if($currentChangeContent !== null){
            $currentChangeContent = htmlspecialchars_decode($currentChangeContent);

            $requestsDirectory = $configuration['requestsDirectory'];

            if(!is_dir($requestsDirectory)){
                mkdir($requestsDirectory, 0775, true);
            }

            $nextRequestContentFilePath = tempnam($requestsDirectory, '');

            file_put_contents($nextRequestContentFilePath, $currentChangeContent);

            header('Location: ?page=confirm');
        }

        return render($views['confirm']);
    },
    'logout' => function() use ($views){
        removeAdminAccess();
        header('Location: ?page=review');
    },
    'login' => function() use ($views){
        // no view, just logic
        $configuration = getConfiguration();

        $inputUsername = getPostValue('username', '');
        $inputPassword = getPostValue('password', '');

        if($inputUsername === $configuration['username'] && $inputPassword === $configuration['password']){
            giveAdminAccess();
            header('Location: ?page=review');
        }else{
            $options = [
                'label' => $configuration['label'],
                'description' => $configuration['description'],
            ];

            if(strlen($inputUsername) || strlen($inputPassword)){
                $options['status'] = 'wrong';
            }else{
                $options['status'] = 'empty';
            }

            return render($views['login'], $options);
        }
    },
    'review' => function() use ($views){

        if(!hasAdminAccess()){
            header('Location: ?page=login');
        }else{
            $configuration = getConfiguration();
            $requestsDirectory = $configuration['requestsDirectory'];
            $currentContent = getCurrentContent($configuration['currentPath']);

            if(!is_dir($requestsDirectory)){
                $changesFiles = [];
            }else{
                $changesFiles = scanDirectory($requestsDirectory.'/*');
            }

            $options = [
                'label' => $configuration['label'],
                'description' => $configuration['description'],
                'currentContent' => $currentContent,
                'changesFiles' => $changesFiles,
                'currentPath' => $configuration['currentPath'],
            ];

            return render($views['review'], $options);
        }
    },
    'reviewaction' => function() use ($views){

        if(!hasAdminAccess()){
            header('Location: ?page=login');
        }else{
            $actionType = getPostValue('type');
            $configuration = getConfiguration();
            $requestsDirectory = $configuration['requestsDirectory'];
            $currentContent = getCurrentContent($configuration['currentPath']);

            if($actionType === 'accept'){
                $changeFilePath = getPostValue('changeFilePath');

                if(startsWith($changeFilePath, $configuration['requestsDirectory'])){
                    $changeContent = file_get_contents($changeFilePath);
                    file_put_contents($configuration['currentPath'], $changeContent);

                    file_put_contents(
                        $configuration['historyPath'], 
                        "\n\n------------------".date('c')."------------------\n\n".$currentContent, 
                        FILE_APPEND
                    );

                    unlink($changeFilePath);
                }
            }else if($actionType === 'reject'){
                $changeFilePath = $_POST['changeFilePath'];
                unlink($changeFilePath);
            }

            header('Location: ?page=review');
        }
    },
    'config' => function() use ($views){
        $current = [
            'username' => getPostValue('username', 'admin'),
            'password' => getPostValue('password', randomPassword()),
            'label' => getPostValue('label'),
            'description' => getPostValue('description'),
            'statePath' => getPostValue('statePath', './change-accept-state'),
        ];

        $postRequest = true;

        foreach($current as $currentElement){

            if($currentElement === null){
                $postRequest = false;
                break;
            }
        }

        $options = [
            'fields' => $current,
        ];

        if(!$postRequest){
            $options['showPassword'] = true;

            return render($views['config'], $options);
        }else{
            $options['showPassword'] = false;

            $allFilled = true;

            foreach($current as $currentElement){

                if($currentElement === null || $currentElement === ''){
                    $allFilled = false;
                    break;
                }
            }

            if($allFilled){
                $savedConfiguration = [
                    'username' => $current['username'],
                    'password' => $current['password'],
                    'label' => $current['label'],
                    'description' => $current['description'],

                    'currentPath' => 'current.txt',
                    'requestsDirectory' => $current['statePath'].'/requests',
                    'historyPath' => $current['statePath'].'/history',
                ];

                $configString = '<?php $configuration = '.var_export($savedConfiguration, true).'; ?>';

                if(file_put_contents(__FILE__, $configString."\n".file_get_contents(__FILE__)) === false){
                    throw new Exception('could not add configuration to '.__FILE__);
                }

                header('Location: ?page=review');
            }else{
                return render($views['config'], $options);
            }
        }

    },
];

$preFilters = [
    [
        'actions' => array_keys($pages),
        'filter' => function($actionName){

            if(!hasConfiguration() && $actionName !== 'config'){
                header('Location: ?page=config');
                return false;
            }else if(hasConfiguration() && $actionName === 'config'){
                header('Location: ?page=review');
                return false;
            }else{
                return true;
            }
        },
    ],
];

$currentPage = getLocation(array_keys($pages), 'request');

$pageLogic = $pages[$currentPage];

if(applyFilters($preFilters, $currentPage)){
    $render = $pageLogic();
}else{
    // filter prevented rendering
    $render = '';
}

