    <script type="text/javascript">
        $('.codemirror').each(function(codemirrorElementIndex, codemirrorElement){
            var codeMirrorInstance = CodeMirror.fromTextArea(codemirrorElement, {
                lineNumbers: true
            });

            if($(codemirrorElement).is(':disabled')){
                codeMirrorInstance.setOption("readOnly", "nocursor") ;
            }
        });

        if($('.container-submit').length){
            var dmp;
            var diffMain;
            var diffPretty;

            dmp = new diff_match_patch();

            dmp.Diff_Timeout = 1;

            diffMain = dmp.diff_main(
                $('input[name="currentContent"]').val(), 
                $('input[name="changeRequestContent"]').val()
            );

            dmp.diff_cleanupSemantic(diffMain);

            diffPretty = dmp.diff_prettyHtml(diffMain);

            $('.diffPretty').html(diffPretty);
        }else if($('.container-review').length){
            // targetContent
            $('.target').each(function(index, element){
                var $element = $(element);

                var dmp;
                var diffMain;
                var diffPretty;

                dmp = new diff_match_patch();

                dmp.Diff_Timeout = 1;

                diffMain = dmp.diff_main(
                    $('.currentContent').val(), 
                    $element.find('.targetContent').val()
                );

                dmp.diff_cleanupSemantic(diffMain);

                diffPretty = dmp.diff_prettyHtml(diffMain);

                $element.find('.targetDiff').html(diffPretty);
            });
        }
